• 6+12 Month federal Government Contract
• Canberra, Woden, ACT, 2 days WFH
• Baseline Clearance Preferred

The Analytics Section of our Federal Government client is looking for a Data Analyst/Engineer to assist in the data management and stewardship of Private Health Insurance. The team are looking for a Data Analyst/Engineer to work on a project to improve the efficiency and transparency of the data integration, assessment and cleansing processes and assist in the design of analytic views for Hospital Casemix Protocol data. The Data Analyst/Engineer may also run ad hoc SQL queries if requested.

The succesful Data Analyst will be:
• Interpreting and translating current SAS code
• Writing SQL code with increased automation, continuous integration, testability, simplicity, efficiency, and maintainability;
• Providing input into the design of derived variables;
• Assessing the impact of derived variables to ensure they are fit for purpose and assure data quality;
• Undertaking quality assurance on load scripts;
• Contributing to the documentation the new standard operating procedures and other supporting materials;
• Provide analysis and evidence-based advice on the refinement of data specifications and derivation activities;
• Assist in assessment and refinement of current validation and compliance activities.

And will have the following skills and experience:
• Proven Teradata SQL/SAS skills;
• Proven Advanced Excel experience (including Power Query M);
• Ability to translate data specifications to practical application for data loading, cleaning, and analytical processes;
• Ability to communicate statistical and technical concepts to a range of stakeholders (including non-technical);
• An understanding of Hospital Casemix Protocol data.

To apply for this opportunity please click the apply button or contact Jon at Recruitment Hive on 02 6299 1006.

This opportunity will close on Tuesday 3rd October at midday, Job ID DM-20517

Australian Citizens residing in Australia only respond.

